import React from "react";
import { StyleSheet } from "react-native";
import ClientHome from "./ClientHome";
import ClientProfile from "./ClientProfile";
import ClientNotifications from "./ClientNotifications";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { Ionicons } from "@expo/vector-icons";
import colors from "../../config/colors";

const Tab = createBottomTabNavigator();

function ClinetTabNavigator() {
  return (
    <Tab.Navigator
      style={styles.tab}
      tabBarOptions={{
        activeTintColor: colors.myblue,
        inactiveTintColor: "gray",
      }}
    >
      <Tab.Screen name="Home"
       component={ClientHome}
       initialParams={{ icon: "notification" }} />
      <Tab.Screen name="Profile" component={ClientProfile} />
      <Tab.Screen name="Notifications" component={ClientNotifications} />
    </Tab.Navigator>
  );
}

export default ClinetTabNavigator;

const styles = StyleSheet.create({
  wrapper: {
    // position:'absolute',
    position: "relative",
    bottom: 1,
    width: 20,
    height: 50,
    backgroundColor: "red",
    alignItems: "center",
    justifyContent: "space-around",
  },
  tab: {
    flexDirection: "row",
    justifyContent: "space-between",
    backgroundColor: "red",
    // width:250,
    // borderRadius:100,
  },
});
